import React from "react";
import styled from "styled-components";
import { LazyLoadImage } from "react-lazy-load-image-component";

const Card = styled.div`
  height: 100%;
  overflow-y: scroll;
  background: ${({ theme }) => theme.bg}
  padding: 30px 30px;
  padding-bottom: 50px;
  display: flex;
  flex-direction: column;
  align-items: center;
  gap: 20px;
  @media (max-width: 768px) {
    padding: 6px 10px;
  }
`;

const ImageCard = () => {
  return (
    <Card>
      <LazyLoadImage src="https://img.freepik.com/premium-photo/close-up-leaf-with-drops-water-it-generative-ai_797840-2114.jpg" />
      
    </Card>
  );
};

export default ImageCard;
